import { Route, Routes } from 'react-router-dom';
import Header from './Header/Header';

const App = () => {
  if (document.location.pathname == '/'){
    document.location.pathname = '/dashboard';
  }

  return (
    <div>
      <Header />
      <Routes>
        <Route index path="/dashboard">

        </Route>
      </Routes>
    </div>
  );
};

export default App;
